package br.com.health.domain.dto.request;

import br.com.health.domain.exception.FieldException;
import io.swagger.annotations.ApiModelProperty;

import javax.validation.constraints.NotNull;
import java.util.Objects;

public class DocumentRequest {

	private Long beneficiaryID;

	@NotNull
	@ApiModelProperty(example = "RG")
	private String typeDocument;

	@NotNull
	@ApiModelProperty(example = "Documento de teste")
	private String description;

	@NotNull
	@ApiModelProperty(example = "")
	private byte[] documentByte;

	public DocumentRequest() {
	}

	public Long getBeneficiaryID() {
		return beneficiaryID;
	}

	public byte[] getDocumentByte() {
		return documentByte;
	}

	public String getTypeDocument() {
		return typeDocument;
	}

	public String getDescription() {
		return description;
	}

	public void validFields(DocumentRequest documentRequest) throws FieldException {
		 if(Objects.isNull(documentRequest.beneficiaryID)
				&& (documentRequest.documentByte == null || documentRequest.documentByte.length == 0)){
			 throw new FieldException("Documento n√£o anexado ou ID de beneficiario nulo");
		 }
	}
}
